import React from 'react'
import {render} from 'react-dom'
function Article() {
    const body = <section>body</section>
    return (
        <div>
            <h2>title</h2>
            {body}
            <h3>
                creation data:{(new Date). toDateString()}
            </h3>
        </div>
    )
}

function App() {
    return(
        <div>
            <h1> App Name</h1>
            <Article> </Article>
        </div>
    )

}

render (<App/>)
